syntax = "proto3";

package proto_log;

message ClientLogHead {
  string event_time = 1;
  string log_serial_number = 2;
  uint32 action_id = 3;
  string action_name = 4;
  string upload_ip = 5;
  string product_id = 6;
  string channel_id = 7;
  string region_name = 8;
  string game_version = 9;
  string device_type = 10;
  string device_uuid = 11;
  string mac_addr = 12;
  string account_name = 13;
  string account_uuid = 14;
}
